//   {path: 'login', component: LoginComponent},
//   {path: 'logout', component: LogoutComponent},
//   // {path: 'users', component: UsersComponent, canActivate: [AuthGuard]},
// ];

@NgModule({
    imports: [
      BrowserModule,
      BrowserAnimationsModule,
      MatButtonModule, 
      MatCheckboxModule,
      MatInputModule,
      MatFormFieldModule,
      MatSidenavModule,
      AppRoutingModule,
      HttpClientModule,
      // RouterModule.forRoot(routes)
    ],
   declarations: [
      AppComponent,
      LeftPanelComponent,
      HeadComponent,
      LoginComponent,
      LogoutComponent,
      NotFoundComponent
    ],
    bootstrap: [AppComponent],
    providers: [AppConfig]
})
export class AppModule { }
